import React, { Component } from 'react';
import Menu from './Menu.js'

import './App.css';
import AllActorsList from './AllActorsList.js';


class Homepage extends Component {
    render(){
      return (
        <div className="App">
            <Menu />
            <MapContainer />
            <AllActorsList />
        </div>
      );
    }
  }

export default Homepage;
